.text
la $a0, start_image
jal draw_fullscreen_image
j wait_for_enter
wait_for_enter: #waits for enter to start
    	# Check keyboard status
    	li   $t0, 0xFFFF0000     # Keyboard status address
    	lw   $t1, 0($t0)         # Load status
   	beq  $t1, $zero, wait_for_enter  # If no key pressed, loop

    	# Read keyboard data
    	li   $t0, 0xFFFF0004     # Keyboard data address
    	lw   $t2, 0($t0)         # Load key ASCII

    	li   $t3, 10             # ASCII for Enter key
    	beq  $t2, $t3, start  # If Enter, jump

    	j wait_for_enter           # Otherwise, wait again


start: #initializes the game
	la $t0, display_address # base + (y * screen + x) * 4
	la $s0, background_color
	lw $s0, 0($s0)
	lw $t0, 0($t0)
	li $a1, 4000 #coord of spike out of screen
	li $a2, 3260 #coord of coin
	li $a0, 0
	l.s $f3, one
	l.s $f2, zero
	l.s $f5, zero
	jal draw_bg
	j draw_first


game_loop: #game loop runs as long as the game is running
	jal flash_cube
	jal draw_health
	jal draw_score
	
    	# Check if health <= 0
   	la $t0, health
   	lw $t1, 0($t0)
   	slt $t9, $zero, $t1
   	beq $t9, $zero, game_over
	
	
	jal keyboard_input_move
	jal draw_spike
	jal spike_fall
	jal draw_coin
	jal coin_fall
	
	j game_loop
	
	
	

draw_first: #draws the initial elements and sets the default coord for the walls and cube
	la $t0, display_address # base + (y * screen + x) * 4
	lw $t0, 0($t0)
	la $s0, background_color
	lw $s0, 0($s0)
	la $s1, block_color
	lw $s1, 0($s1)
	#lw $t0, 0($t0)
	li $t1, 150 #x 
	li $t2, 220 #y
	li $s3, 256 #screen_size
	
	#dimensions of cube
	li $s4, 30 #x
	li $s5, 30 #y
	
	#calculate coordinates base + (y * screen + x) * 4
	mul $t4, $t2, $s3 
	add $t5, $t1, $t4
	sll $t5, $t5, 2
	add $t5, $t5, $t0
	
	#backup it
	add $s2, $t5, $zero
	
	add $t4, $s4, $zero #x_size counter for loop
	add $t6, $s5, $zero #y_size
	
	#Calculate wall_left (base + (y*screen)*4)
	#(base + (200*256)*4)
	mul $t2, $s3, $t2
	sll $t2, $t2, 2
	add $s6, $t0, $t2  #save wall_left
	
	
	#Calculate wall_right (wall_left + (screen - cube_width)*4)
	sub $t2, $s3, $s4
	sll $t2, $t2, 2
	add $s7, $s6, $t2 #save wall_right
	
	addi $s7, $s7, -32 #so the cube doesn't go through the wall(aka thickness)
	addi $s6, $s6, 32
	
	Loop_x:
	sw $s1, 0($t5) #colors
	addi $t5, $t5, 4 #moves to next pixel
	addi $t4, $t4, -1 #decrements x pixel count
	bne $t4, $zero, Loop_x
	addi $t6, $t6, -1 #decrements y pixel count
	add $t4, $s4, $zero        #loads x count to 50 after line ends
	sll $t4, $t4, 2   #multily by 4 for word size
	sub $t5, $t5, $t4 #bring back pointer to start of the line
	srl $t4, $t4, 2   #restores base value of x count
	sll $t3, $s3, 2   #multiplies width by 4 for word size
	add $t5, $t5, $t3 #adds width to pointer to jump to next line(y)
	
	bne $t6, $zero, Loop_x
	jal draw_health
	jal draw_score
	j game_loop

draw_cube:
	# Save return address
    	addi $sp, $sp, -4
    	sw $ra, 0($sp)
    	
    	# Draw cube with current color (stored in $s1)
	la $t1, cube_width
    	la $t2, cube_height
    	lw $t1, 0($t1)
    	add $t4, $t1, $zero
    	sll $t6, $t4, 2
    	lw $t2, 0($t2)
    	la $t3, screen_width
    	lw $t3, 0($t3)
    	sll $t3, $t3, 2
    	add $t5, $s2, $zero

	jal cube_draw_loop
	
	#restore address
	lw $ra, 0($sp)
	addi $sp, $sp 4
	jr $ra
	
	cube_draw_loop:
		
		sw $s1, 0($t5)
		addi $t1, $t1, -1 #width counter
		addi $t5, $t5, 4 #goes to next pixel
		bne $t1, $zero, cube_draw_loop
		addi $t2, $t2, -1 #height counter
		add $t1, $t4, $zero #reset width counter
		sub $t5, $t5, $t6   #sets pointer to begining
		add $t5, $t5, $t3   #sets pointer to next line (base + width*4)
		bne $t2, $zero, cube_draw_loop
		jr $ra
		
draw_bg: #draws the background image
	la $t1, pixels
	lw $t1, 0($t1)
	la $t5, display_address #counter starts at base
	lw $t5, 0($t5)
	
	la $t4, background_image
	
	addi $sp, $sp -4 #save $ra before next jal
	sw $ra, 0($sp)
	jal draw_bg_loop
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
	draw_bg_loop:
	lw $t6, 0($t4)
	sw $t6, 0($t5)
	addi $t5, $t5, 4
	addi $t1, $t1, -1
	addi $t4, $t4, 4
	bne $t1, $zero, draw_bg_loop
	jr $ra
	
move_left: #draws pixels to the left and fills with background to the right
	slt $t0, $s2, $s6
	bne $t0, $zero, wall_hit #checks if the cube is near the wall
	la $t0, display_address
	lw $t0, 0($t0)
	la $t1, cube_width
	lw $t1, 0($t1)
	add $t9, $t1, $zero #backup for restore in loop
	la $t4, background_image
	la $s1, block_color
	lw $s1, 0($s1)
	add $t5, $s2, $zero #move location to t5
	li $t7, 10 #speed
	
	
	
	sub $t2, $s2, $t0  #sub (cube location - base) to get coord
	add $t2, $t2, $t4  #set pointer on background pixel where cube is
	sll $t3, $t1, 2
	
	add $t6, $s2, $t3 #pointer to right of cube
	add $t2, $t2, $t3 #set background pointer to right of cube
	addi $t5, $t5, -4 #prepare to move left
	
	la $t3, screen_width
	lw $t3, 0($t3)
	sll $t3, $t3, 2  #to jump to next line
	#(256*50*4)step to go back up
	mul $t8, $t3, $t1
	
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	jal move_left_loop
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
	move_left_loop:
	lw $t4, 0($t2)
	sw $t4, 0($t6)
	sw $s1, 0($t5)
	addi $t1, $t1, -1  #decretment pixel counter
	add $t5, $t5, $t3 #to go to next line
	add $t6, $t6, $t3
	add $t2, $t2, $t3
	bne $t1, $zero, move_left_loop
	sub $t5, $t5, $t8
	sub $t2, $t2, $t8
	sub $t6, $t6, $t8
	addi $t2, $t2, -4
	addi $t6, $t6, -4
	addi $t5, $t5, -4
	
	
	add $t1, $t9, $zero
	addi $t7, $t7, -1
	bne $t7, $zero, move_left_loop
	addi $s2, $t5, 4
	jr $ra
	
	
move_right:
	sgt $t0, $s2, $s7
	bne $t0, $zero, wall_hit #checks if the cube is near the wall
	la $t0, display_address
	lw $t0, 0($t0)
	la $t1, cube_width
	lw $t1, 0($t1)
	add $t9, $t1, $zero #t9 = 50 (width)
	la $t4, background_image
	la $s1, block_color
	lw $s1, 0($s1)
	add $t5, $s2, $zero #move location to t5
	li $t7, 10 #speed
	
	
	
	sub $t2, $s2, $t0  #sub cube (location - base) to get step
	add $t2, $t2, $t4  #(img base + step)
	sll $t3, $t1, 2	   #(50 * 4) width step
	
	add $t6, $s2, $t3 #pointer to right of cube
	#add $t2, $t2, $t3 #set background pointer to right of cube
	addi $t6, $t6, 4 #prepare to move right
	
	la $t3, screen_width
	lw $t3, 0($t3)
	sll $t3, $t3, 2  #to jump to next line (256*4)
	
	mul $t8, $t3, $t1 #(256*50*4)step to go back up
	
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	jal move_right_loop
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
	move_right_loop:
	lw $t4, 0($t2)
	sw $t4, 0($t5)
	sw $s1, 0($t6)
	addi $t1, $t1, -1  #decretment pixel counter
	add $t5, $t5, $t3 #to go to next line
	add $t6, $t6, $t3
	add $t2, $t2, $t3
	bne $t1, $zero, move_right_loop
	sub $t5, $t5, $t8
	sub $t2, $t2, $t8
	sub $t6, $t6, $t8
	addi $t2, $t2, 4
	addi $t6, $t6, 4
	addi $t5, $t5, 4
	
	
	add $t1, $t9, $zero
	addi $t7, $t7, -1
	bne $t7, $zero, move_right_loop
	add $s2, $t5, $zero
	jr $ra
	
keyboard_input_move: #detects A and D keyboard presses
	li $t1, 0xFFFF0000     # Load address of keyboard status register
    	li $t2, 0xFFFF0004     # address of keyboard pressed key
    	lw $t1, 0($t1)	       #loads value of is_key_pressed
    	bne $t1, $zero, key_receptor
    	jr $ra
key_receptor:
	lw $a3, 0($t2)
	li $t1, 'a'
	li $t2, 'd'
	beq $a3, $t2, move_right
	beq $a3, $t1, move_left
	
	jr $ra
	
wall_hit:
	jr $ra
	
draw_spike: #draws the obstacle after each fall at a random start location
	li $t3, 231424
	sgt $t3, $a1, $t3 #checks if coord of spike out of screen before drawing
	beq $t3, $zero, spike_skip
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	jal delete_spike
	
	lw $ra, 0($sp)
	addi $sp, $sp 4
	
	#Random generator
	li $a0, 13 #seed
	li $a1, 1024 #upper bound
	li $v0, 42 #random gen
	syscall
	addi $a0, $a0, 1 #lower bound
	andi $a0, $a0, 0xFFFFFFFC #makes sure the last 2 bits are 0(divisible by 4)
	add $a1, $a0, $zero #load the random point into spike coord

	jr $ra
	
spike_fall: #makes the spike fall a certain distance after each cycle , filling background behind it
	l.s $f1, cycle #cycles between each fall step
	c.eq.s $f1, $f2
	bc1f spike_fall_skip
	#bne $a0, $t1, spike_fall_skip
	la $t0, display_address
	lw $t0, 0($t0)
	
	
	
	add $t1, $t0, $a1 #coord of spike
	sll $t2, $s3, 2 #256*4
	
	li $t3, 30 #height
	
	
	mul $t3, $t2, $t3 #(30*256*4) 
	#add $t3, $t3, $t2 #pushes pointer 1 line down +256*4
	add $t3, $t1, $t3 #put pointer at lower end of spike
	
	la $t4, background_image
	add $t4, $t4, $a1 #sets pointer on image (to fill behind spike)
	sub $t4, $t4, $t2
	li $t6, 1 #pixel to move per game loop(speed)
	
	
	la $t7, spike_color
	lw $t7, 0($t7)
	
	li $t8, 10 #width
	add $t9, $t8, $zero #backup to restore
	sll $t0, $t8, 2 #step to go back to start of line
	
	
	#update coordinates of spike
	#mul $t9, $s3, $t6
	
	
	#add $t9, $t8, $zero
	
	#save and restore $ra
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	jal spike_fall_loop
	lw $ra, 0($sp)
	addi $sp, $sp 4
	l.s $f2, zero #reset fall time
	#li $a0, 0 
	jr $ra
	
	spike_fall_loop:
	lw $t5, 0($t4)
	sw $t5, 0($t1) #fill with bg pixels
	
	# Check if spike is touching cube
	la $t5, block_color
   	lw $t5, 0($t5)   # Load cube color
    	lw $t7, 0($t3)   # Load pixel color where spike would be drawn
    	beq $t5, $t7, spike_hit_cube  # If colors match, collision
    	
    	# ==== NO COLLISION ====
    	la $t7, spike_color     # Keep falling
    	lw $t7, 0($t7)
    	sw $t7, 0($t3)          # Draw spike at new position
    	j spike_continue        # Go to next pixel
    	
spike_continue: #in case of no collision
	addi $t4, $t4, 4 #image pointer
	addi $t1, $t1, 4 #top pointer
	addi $t3, $t3, 4 #bottom pointer
	addi $t8, $t8, -1
	
	bne $t8, $zero, spike_fall_loop
	add $t4, $t4, $t2 #go to next line
	add $t1, $t1, $t2 #go to next line
	add $t3, $t3, $t2 #go to next line
	
	sub $t4, $t4, $t0 #go to start of line (coord - width) 
	sub $t1, $t1, $t0 #go to start of line
	sub $t3, $t3, $t0 #go to start of line
	
	add $t8, $t9, $zero #reset width counter
	addi $t6, $t6 -1 #decrement speed counter
	addi $a1, $a1, 1024 #update coord by 1 line (256*4)
	bne $t6, $zero, spike_fall_loop
	#li $a0, 0
	
	
	
	la $t0, display_address
	lw $t0, 0($t0)
	
	jr $ra
	
spike_hit_cube: 
#On spike collision with cube, used to reduce health, play a sound, and check for game over
	
    	# Save registers
    	addi $sp, $sp, -16
    	sw $ra, 0($sp)
    	sw $t0, 4($sp)
    	sw $t1, 8($sp)
    	sw $s1, 12($sp)

    	jal play_damage_sound
    	# Reduce health
    	la $t0, health
    	lw $t1, 0($t0)
    	addi $t1, $t1, -1
    	sw $t1, 0($t0)
    
    	jal draw_health #update health count
    
    	# Activate hit feedback 
    	li $t1, 10
    	la $t0, hit_counter
    	sw $t1, 0($t0)
    
    	# Delete the spike
    	jal delete_spike
    
    	# Restore cube color immediately
    	la $s1, block_color
    	lw $s1, 0($s1)
    	jal draw_cube
    
    	# Check for game over (after visual feedback)
    	la $t0, health
    	lw $t1, 0($t0)
    	slt $t9, $zero, $t1
   	beq $t9, $zero, game_over
    
    	# Restore registers
    	lw $ra, 0($sp)
    	lw $t0, 4($sp)
    	lw $t1, 8($sp)
    	lw $s1, 12($sp)
    	addi $sp, $sp, 16
    
    	j spike_fall_done
    
spike_fall_done:            	# Landing spot after collision
    	jr $ra                  # Return from function
	
spike_skip:
	jr $ra	
	
spike_fall_skip:
	add.s $f2, $f2, $f3 #cycle + 1
	#addi $a0, $a0, 1
	jr $ra		
	
delete_spike: #deletes the spike once it touches the ground
	la $t0, display_address
	lw $t0, 0($t0)
	
	la $t2, background_image
	add $t1, $t0, $a1
	add $t3, $t2, $a1
	
	li $t5, 10
	li $t6, 30
	li $t7, 10
	sll $t8, $s3, 2
	sll $t9, $t7, 2
	
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	jal delete_spike_loop
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	li $a1, 4000 #reset spike position
	
	#Random generator
	li $a0, 13 #seed
	li $a1, 1024 #upper bound
	li $v0, 42 #random gen
	syscall
	addi $a0, $a0, 1 #lower bound
	andi $a0, $a0, 0xFFFFFFFC #makes sure the last 2 bits are 0(divisible by 4)
	add $a1, $a0, $zero #load the random point into spike coord
	
	jr $ra
	
	delete_spike_loop: 
	lw $t4, 0($t3)
	sw $t4, 0($t1)
	addi $t3, $t3, 4
	addi $t1, $t1, 4
	addi $t5, $t5, -1
	bne $t5, $zero, delete_spike_loop
	addi $t6, $t6, -1
	add $t5, $t7, $zero
	sub $t3, $t3, $t9
	sub $t1 $t1, $t9
	add $t3, $t3, $t8
	add $t1, $t1, $t8
	bne $t6, $zero, delete_spike_loop
	jr $ra
	
draw_coin: #like draw spike but for the coin
	li $t3, 231424
	sgt $t3, $a2, $t3 #checks if coord of coin out of screen before drawing
	beq $t3, $zero, coin_skip
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	jal delete_coin
	
	lw $ra, 0($sp)
	addi $sp, $sp 4
	
	#Random generator
	li $a0, 500699 #just a random int
	add $t3, $a1, $zero
	li $a1, 2048 #upper bound
	li $v0, 42 #random gen
	syscall
	addi $a0, $a0, 1068 #lower bound
	andi $a0, $a0, 0xFFFFFFFC #makes sure the last 2 bits are 0(divisible by 4)
	add $a2, $a0, $zero #load the random point into coin coord
	add $a1, $t3, $zero

	jr $ra
	
coin_fall:   	
	l.s $f4, cycle #cycles between each fall step
	c.eq.s $f4, $f5
	bc1f coin_fall_skip
	#bne $a0, $t1, coin_fall_skip
	la $t0, display_address
	lw $t0, 0($t0)
	
	add $t1, $t0, $a2 #coord of coin
	sll $t2, $s3, 2 #256*4
	
	li $t3, 10 #height
	
	mul $t3, $t2, $t3 #(10*256*4) 
	#add $t3, $t3, $t2 #pushes pointer 1 line down +256*4
	add $t3, $t1, $t3 #put pointer at lower end of coin
	
	la $t4, background_image
	add $t4, $t4, $a2 #sets pointer on image (to fill behind coin)
	sub $t4, $t4, $t2
	li $t6, 1 #pixel to move per game loop(speed)
	
	
	la $t7, coin_color
	lw $t7, 0($t7)
	
	li $t8, 10 #width
	add $t9, $t8, $zero #backup to restore
	sll $t0, $t8, 2 #step to go back to start of line
	
	#save and restore $ra
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	jal coin_fall_loop
	lw $ra, 0($sp)
	addi $sp, $sp 4
	l.s $f5, zero #reset fall time
	#li $a0, 0 
	jr $ra
	
	coin_fall_loop:
	lw $t5, 0($t4)
	sw $t5, 0($t1) #fill with bg pixels
	
	 # Check if coin is touching cube (same as spike collision check)
    	la $t5, block_color
    	lw $t5, 0($t5)   # Load cube color
    	lw $t7, 0($t3)   # Load pixel color where coin would be drawn
   	beq $t5, $t7, coin_hit_cube  # If colors match, collision
	
	# NO Collision
	la $t7, coin_color
	lw $t7, 0($t7)
	sw $t7, 0($t3) #fill bottom with coin color
	j coin_continue

coin_continue:
    	addi $t4, $t4, 4 #image pointer
    	addi $t1, $t1, 4 #top pointer
    	addi $t3, $t3, 4 #bottom pointer
    	addi $t8, $t8, -1
	
    	bne $t8, $zero, coin_fall_loop
    	add $t4, $t4, $t2 #go to next line
    	add $t1, $t1, $t2 #go to next line
    	add $t3, $t3, $t2 #go to next line

    	sub $t4, $t4, $t0 #go to start of line (coord - width) 
    	sub $t1, $t1, $t0 #go to start of line 
    	sub $t3, $t3, $t0 #go to start of line
	
    	add $t8, $t9, $zero #reset width counter
    	addi $t6, $t6 -1 #decrement speed counter
    	addi $a2, $a2, 1024 #update coord by 1 line (256*4)
    	bne $t6, $zero, coin_fall_loop
    	
	
    	la $t0, display_address
    	lw $t0, 0($t0)
	
    	jr $ra   
    
coin_hit_cube:
#On spike collision with cube, used to increase score, play  coin sound, and check for game win


    	# Save registers
    	addi $sp, $sp, -12
    	sw $ra, 0($sp)
    	sw $t0, 4($sp)
    	sw $t1, 8($sp)
    
    	jal play_coin_sound
    
    	# Increase score
    	la $t0, score
    	lw $t1, 0($t0)
    	addi $t1, $t1, 1
    	sw $t1, 0($t0)
 	
    	li $v0, 1       # Print integer
    	lw $a0, score   # Load score
    	syscall
    
    	# Delete the coin
    	jal delete_coin
    	jal draw_score
    
     	# Restore cube color immediately
    	la $s1, block_color
    	lw $s1, 0($s1)
    	jal draw_cube
    
    	# Check if score reached 5
    	li $t0, 5
    	lw $t1, score
    	slt $t9, $t1, $t0
    	beq $t9, $zero, game_win
    
    	# Restore registers
    	lw $ra, 0($sp)
    	lw $t0, 4($sp)
    	lw $t1, 8($sp)
    	addi $sp, $sp, 12
    
    	j coin_fall_done
    
coin_fall_done:
    	jr $ra

coin_skip:
	jr $ra	
	
coin_fall_skip:
	add.s $f5, $f5, $f3 #cycle + 1
	#addi $a0, $a0, 1
	jr $ra		
	
delete_coin: #deletes the coin once it touches the ground
	la $t0, display_address
	lw $t0, 0($t0)
	
	la $t2, background_image
	add $t1, $t0, $a2
	add $t3, $t2, $a2
	
	li $t5, 10
	li $t6, 10
	li $t7, 10
	sll $t8, $s3, 2
	sll $t9, $t7, 2
	
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	jal delete_coin_loop
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	li $a2, 3060 #reset coin position
	
	#Random generator
	li $a0, 500699 #just a random int
	add $t3, $a1, $zero
	li $a1, 2048 #upper bound
	li $v0, 42 #random gen
	syscall
	addi $a0, $a0, 1068 #lower bound
	andi $a0, $a0, 0xFFFFFFFC #makes sure the last 2 bits are 0(divisible by 4)
	add $a2, $a0, $zero #load the random point into coin coord
	add $a1, $t3, $zero
	
	jr $ra
	
	delete_coin_loop: 
	lw $t4, 0($t3)
	sw $t4, 0($t1)
	addi $t3, $t3, 4
	addi $t1, $t1, 4
	addi $t5, $t5, -1
	bne $t5, $zero, delete_coin_loop
	addi $t6, $t6, -1
	add $t5, $t7, $zero
	sub $t3, $t3, $t9
	sub $t1 $t1, $t9
	add $t3, $t3, $t8
	add $t1, $t1, $t8
	bne $t6, $zero, delete_coin_loop
	jr $ra
	
draw_health: 
#Used to draw health bar
    	# Save registers
    	addi $sp, $sp, -20
    	sw $ra, 0($sp)
    	sw $t0, 4($sp)
    	sw $t1, 8($sp)
    	sw $t2, 12($sp)
    	sw $t3, 16($sp)

    	# Load health count
    	la $t0, health
    	lw $t1, 0($t0)          # Current health (0-3)

    	# Load display address
    	la $t0, display_address
    	lw $t0, 0($t0)          # Base address

    	# Calculate position
    	la $t2, health_y
    	lw $t2, 0($t2)          # Y position
    	la $t3, health_x
    	lw $t3, 0($t3)          # X position
    
    	li $t4, 256             # Screen width
    	mul $t2, $t2, $t4       # y * width
    	add $t2, $t2, $t3       # y * width + x
    	sll $t2, $t2, 2         # *4 for word offset
    	add $t0, $t0, $t2       # Final position

    	# Load colors
    	la $t2, health_icon
    	lw $t2, 0($t2)          # Health color (red)
    	la $t3, background_color
    	lw $t3, 0($t3)          # Background (black)

    	# Draw 3 health slots
    	li $t4, 0               # Health counter (0-2)
health_loop:
    	slt $t5, $t4, $t1       # 1 if should draw health
    	beq $t5, $zero, draw_bg_health

    	add $t6, $t2, $zero           # Use health color
    	j draw_health_block
draw_bg_health:
    	add $t6, $t3, $zero           # Use bg color

draw_health_block:
#Draws each block of the health bar
    	# Draw 4x4 block
    sw $t6, 0($t0)
    sw $t6, 4($t0)
    sw $t6, 8($t0)
    sw $t6, 12($t0)
    
    addi $t0, $t0, 1024     # Next line
    sw $t6, 0($t0)
    sw $t6, 4($t0)
    sw $t6, 8($t0)
    sw $t6, 12($t0)
    
    addi $t0, $t0, 1024     # Next line
    sw $t6, 0($t0)
    sw $t6, 4($t0)
    sw $t6, 8($t0)
    sw $t6, 12($t0)
    
    addi $t0, $t0, 1024     # Next line
    sw $t6, 0($t0)
    sw $t6, 4($t0)
    sw $t6, 8($t0)
    sw $t6, 12($t0)
    
    # Move to next health position
    addi $t0, $t0, -3072    # Back to top
    addi $t0, $t0, 20       # Move right 5 pixels

    addi $t4, $t4, 1
    slti $t9, $t4, 3
    bne $t9, $zero, health_loop

health_done:
    # Restore registers
    lw $ra, 0($sp)
    lw $t0, 4($sp)
    lw $t1, 8($sp)
    lw $t2, 12($sp)
    lw $t3, 16($sp)
    addi $sp, $sp, 20
    jr $ra
    
draw_score:
#Used to draw score bar
    # Save registers
    addi $sp, $sp, -20
    sw $ra, 0($sp)
    sw $t0, 4($sp)
    sw $t1, 8($sp)
    sw $t2, 12($sp)
    sw $t3, 16($sp)

    # Load score value
    la $t0, score
    lw $t1, 0($t0)          # Current score (0 5)

    # Load display address
    la $t0, display_address
    lw $t0, 0($t0)          # Base address

    # Calculate position
    la $t2, score_y
    lw $t2, 0($t2)          # Y position
    la $t3, score_x
    lw $t3, 0($t3)          # X position

    li $t4, 256             # Screen width
    mul $t2, $t2, $t4       # y * width
    add $t2, $t2, $t3       # y * width + x
    sll $t2, $t2, 2         # *4 for word offset
    add $t0, $t0, $t2       # Final position

    # Load colors
    la $t2, score_icon
    lw $t2, 0($t2)          # Score color (e.g., yellow)
    la $t3, background_color
    lw $t3, 0($t3)          # Background (e.g., black)

    # Draw 5 score slots
    li $t4, 0               # Score slot counter (0 4)
score_loop:
    slt $t5, $t4, $t1       # 1 if should draw filled score
    beq $t5, $zero, draw_bg_score

    add $t6, $t2, $zero           # Use score color
    j draw_score_block
draw_bg_score:
    add $t6, $t3, $zero           # Use background color

draw_score_block:
#used to draw each score block of the score 
    # Draw 4x4 block
    sw $t6, 0($t0)
    sw $t6, 4($t0)
    sw $t6, 8($t0)
    sw $t6, 12($t0)

    addi $t0, $t0, 1024     # Next row
    sw $t6, 0($t0)
    sw $t6, 4($t0)
    sw $t6, 8($t0)
    sw $t6, 12($t0)

    addi $t0, $t0, 1024     # Next row
    sw $t6, 0($t0)
    sw $t6, 4($t0)
    sw $t6, 8($t0)
    sw $t6, 12($t0)

    addi $t0, $t0, 1024     # Next row
    sw $t6, 0($t0)
    sw $t6, 4($t0)
    sw $t6, 8($t0)
    sw $t6, 12($t0)

    # Move to next score block
    addi $t0, $t0, -3072    # Back to top row
    addi $t0, $t0, 20       # Move right (5 pixels * 4 bytes per pixel)

    addi $t4, $t4, 1
    slti $t9, $t4, 5
    bne $t9, $zero, score_loop

score_done:
    # Restore registers
    lw $ra, 0($sp)
    lw $t0, 4($sp)
    lw $t1, 8($sp)
    lw $t2, 12($sp)
    lw $t3, 16($sp)
    addi $sp, $sp, 20
    jr $ra

    
flash_cube:
#On collision with spike flashes the cube red and updates the hit counter
    # Save registers
    addi $sp, $sp, -8
    sw $ra, 0($sp)
    sw $t0, 4($sp)
    
    # Check if we should flash
    la $t0, hit_counter
    lw $t1, 0($t0)
    beq $t1, $zero, no_flash
    
    # Decrement counter
    addi $t1, $t1, -1
    sw $t1, 0($t0)
    
    # Alternate between normal and hit color
    andi $t2, $t1, 1    # Check if counter is odd/even
    beq $t2, $zero, normal_color
    
    # Flash color
    la $s1, hit_color
    lw $s1, 0($s1)
    j redraw_cube
    
normal_color:
    la $s1, block_color
    lw $s1, 0($s1)
    
redraw_cube:
    # Redraw cube with current color
    jal draw_cube
    
no_flash:
    # Restore registers
    lw $ra, 0($sp)
    lw $t0, 4($sp)
    addi $sp, $sp, 8
    jr $ra
    
# a0 = image address
draw_fullscreen_image:
#Used to draw images, menu, game over image, game win image
    addi $sp, $sp, -16
    sw $ra, 0($sp)
    sw $t0, 4($sp)   # Display pointer
    sw $t1, 8($sp)   # Image pointer
    sw $t2, 12($sp)  # Loop counter

    la $t0, display_address
    lw $t0, 0($t0)   # Base display address

    add $t1, $a0, $zero    # Image pointer from argument

    li $t2, 65536    # 256 x 256 = total pixels

draw_img_loop:
    beq $t2, $zero, draw_img_done

    lw $t3, 0($t1)   # Load pixel
    sw $t3, 0($t0)   # Store to display

    addi $t1, $t1, 4
    addi $t0, $t0, 4
    addi $t2, $t2, -1
    j draw_img_loop

draw_img_done:
    	lw $ra, 0($sp)
    	lw $t0, 4($sp)
    	lw $t1, 8($sp)
    	lw $t2, 12($sp)
    	addi $sp, $sp, 16
    	jr $ra


game_over:
#On game lost by health becoming 0 this function manages game over functionality
    	# Clear screen
    	jal draw_bg

    	jal play_gameover_sound1
    
    	# Show game over image
    	la $a0, gameover_image
    	jal draw_fullscreen_image
    	
    
    	# Wait 2 seconds before exiting
    	li $v0, 32
    	li $a0, 2000
    	syscall
    
    	# Exit program
    	li $v0, 10
    	syscall

game_win:
#On game lost by health becoming 0 this function manages game over functionality
    	# Clear screen
    	jal draw_bg
    
    	jal play_win_sound
    
    	la $a0, win_image
    	jal draw_fullscreen_image
    	jal play_win_sound
    
    	# Wait 2 seconds before exiting
    	li $v0, 32
    	li $a0, 2000
    	syscall
    
    	# Exit program
    	li $v0, 10
    	syscall

